typedef TotemIconData = String;

class TotemIcon extends StatelessWidget {
  const TotemIcon(
    this.icon, {
    super.key,
    this.size,
    this.color,
    this.fillColor = true,
  });

  final TotemIconData icon;
  final double? size;
  final Color? color;
  final bool fillColor;

  @override
  Widget build(BuildContext context) {
    final iconTheme = IconTheme.of(context);
    final iconSize = size ?? iconTheme.size ?? 24.0;
    final iconColor = color ?? iconTheme.color ?? Colors.black;

    return SvgPicture.string(
      icon,
      width: iconSize,
      height: iconSize,
      colorFilter: fillColor
          ? ColorFilter.mode(iconColor, BlendMode.srcIn)
          : null,
      alignment: AlignmentDirectional.center,
    );
  }
}
